  false,\n\t\"url\": null,\n\t\"notes\": \"Temperature data were collected from 1712
  XBT casts in the Eastern Basin, Ionian Sea, Ligurian Sea, Strait of Gibraltar, Tyrrhenian
  Sea and the North Atlantic, South Atlantic, and Indian Ocean from October 1994 to
  September 2010. Data were collected and submitted by the NOAA Atlantic Oceanographic
  and Meteorological Laboratory as part of the High Resolution XBT Network for lines
  AX1, AX2, AX7, AX8, AX10, AX18, AX97, MX1, and MX9. These data were also collected
  in support of the Ship of Opportunity (SOOP) and the Global Temperature Salinity
  Pilot Project (GTSPP).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
